pragma solidity ^0.8.0;
import "@uniswap/v3-periphery/contracts/interfaces/IQuoter.sol";

contract swapQuoter is IQuoter{

    function quoteExactInput(bytes memory path, uint256 amountIn) override external returns (uint256 amountOut){
        uint256 amount = 0;
        return amount;
    }

    function quoteExactOutput(bytes memory path, uint256 amountOut) override external returns (uint256 amountIn){
        uint256 amount = 0;
        return amount;
    }

    function quoteExactInputSingle(
        address tokenIn,
        address tokenOut,
        uint24 fee,
        uint256 amountIn,
        uint160 sqrtPriceLimitX96
    ) override external returns (uint256 amountOut){
        uint256 amount = 0;
        return amount;
    }

    function quoteExactOutputSingle(
        address tokenIn,
        address tokenOut,
        uint24 fee,
        uint256 amountOut,
        uint160 sqrtPriceLimitX96
    ) override external returns (uint256 amountIn){
        uint256 amount = 0;
        return amount;
    }

}

